    static public int longestSubSequence(int[] nums) {
        Set<Integer> uniqueSet = new HashSet<>();
        for (int num : nums) {
            uniqueSet.add(num);
        }
        int maxSeq = 0;
        for (Integer num : uniqueSet) {
            int numSeqStart = num - 1;
            if (!uniqueSet.contains(numSeqStart)) {
                int currentNum = num;
                int currentSeq = 0;
                while (uniqueSet.contains(currentNum)) {
                    currentNum ++;
                    currentSeq ++;
                }
                maxSeq = Math.max(maxSeq, currentSeq);
            }
        }
        return maxSeq;

    }

    static public boolean isValidSudoku(char[][] board) {

        List<HashSet<Character>> rows = new ArrayList<>();
        List<HashSet<Character>> cols = new ArrayList<>();
        List<HashSet<Character>> boxes = new ArrayList<>();

        for (int i = 0; i < 9 ; i++) {
            rows.add(new HashSet<>());
            cols.add(new HashSet<>());
            boxes.add(new HashSet<>());
        }

        for (int i = 0; i < 9 ; i++) {
            for (int j = 0; j < 9; j ++) {
                char currentChar = board[i][j];
                if (currentChar == '.') {
                    continue;
                }
                int boxIndex = (i / 3) * 3 + j / 3;
                if (rows.get(i).contains(currentChar) || cols.get(j).contains(currentChar) || boxes.get(boxIndex).contains(currentChar)) {
                    return false;
                }
                rows.get(i).add(currentChar);
                cols.get(j).add(currentChar);
                boxes.get(boxIndex).add(currentChar);
            }
            System.out.println(" ");
        }
        return true;
    }

    /*
    using prefix and suffix
    [1, 1, 2, 8] * [48, 24, 6, 1]
     */
    static public int[] productExceptSelf2(int[] nums) {
        int[] prefix = new int[nums.length];
        int[] suffix = new int[nums.length];
        int[] output = new int[nums.length];
        int product = 1;
        prefix[0] = product;
        for (int i = 1; i < nums.length; i ++) {
            prefix[i] = prefix[i-1] * nums[i-1];
        }

        suffix[nums.length - 1] = product;

        for (int i = nums.length-1; i > 0; i --) {
            suffix[i-1] = suffix[i] * nums[i];
        }
        for (int i = 0; i < nums.length; i ++) {
            output[i] = prefix[i] * suffix[i];
        }
        return output;
    }

    static public int[] productExceptSelf(int[] nums) {
        int[] finalProd = new int[nums.length];
        for (int i = 0; i < nums.length; i++) {
            int prod = 1;
            for (int j = 0; j < nums.length; j++) {
                if (!(i == j))
                    prod = prod * nums[j];
            }
            finalProd[i] = prod;
        }
        System.out.println(Arrays.toString(finalProd));
        return finalProd;
    }

    /*
    Input: nums = [1,2,2,3,3,3], k = 2
    Output: [2,3]
     */
    static public int[] topKFrequent(int[] nums, int k) {
        int[] topE = new int[k];
        Map<Integer, Integer> freqMap = new HashMap<>();
        for (int num : nums) {
            freqMap.put(num, freqMap.getOrDefault(num, 0) + 1);
        }
        Queue<Map.Entry<Integer, Integer>> sortedQueue = new PriorityQueue<>(
                (o1, o2) -> o2.getValue() - o1.getValue()
        );
        sortedQueue.addAll(freqMap.entrySet());

        // Extract the top k frequent elements
        for (int i = 0; i < k; i++) {
            topE[i] = Objects.requireNonNull(sortedQueue.poll()).getKey();
        }

        return topE;
    }

    /*
    Input: strs = ["act","pots","tops","cat","stop","hat"]
    Output: [["hat"],["act", "cat"],["stop", "pots", "tops"]]
    1. create a hash key at alp variable
    2. hash is created using alphabets from a to z;
    3. locate location of each alphabet, and increment it's value
    4. example for "aabbc" -> [2, 2, 1], and then join it using normal join or append ops
    5. once that is done, then add that to map when hash value is same
     */
    static void groupAnagrams(String[] strs) {
        Map<String, List<String>> hashedStrings = new HashMap<>();
        for (String s : strs) {
            int[] alp = new int[26];
            for (char c : s.toCharArray()) {
                alp[c - 'a']++;
            }
            StringBuilder key = new StringBuilder();
            for (int count : alp) {
                key.append(count).append('#');
            }
            hashedStrings.computeIfAbsent(String.valueOf(key), k -> new ArrayList<>()).add(s);
        }
        List<List<String>> anagramList = new ArrayList<>(hashedStrings.values());
        System.out.println(anagramList);
    }

    static void groupAnagrams2(String[] strs) {
        Map<String, List<String>> hashedStrings = new HashMap<>();
        for (String s : strs) {
            char[] chars = s.toCharArray();
            Arrays.sort(chars);
            String key = new String(chars);
            hashedStrings.computeIfAbsent(key, k -> new ArrayList<>()).add(s);
        }
        List<List<String>> anagramList = new ArrayList<>(hashedStrings.values());
        System.out.println(anagramList);
    }

    static public boolean hasDuplicate(int[] nums) {
        Set<Integer> uniques = new HashSet<>();
        for (int num : nums) {
            if (!uniques.contains(num))
                uniques.add(num);
            else
                return true;
        }
        return false;
    }

    static boolean validAnagram(String s1, String s2) {
        Map<Character, Integer> freqCountS1 = new HashMap<>();
        Map<Character, Integer> freqCountS2 = new HashMap<>();
//        if (s1.length() != s2.length())
//            return false;
        for (Character c : s1.toCharArray()) {
            freqCountS1.put(c, freqCountS1.getOrDefault(c, 0) + 1);
        }
        for (Character c : s2.toCharArray()) {
            freqCountS2.put(c, freqCountS2.getOrDefault(c, 0) + 1);
        }
        for (Character c : freqCountS1.keySet()) {
            if (!(Objects.equals(freqCountS1.get(c), freqCountS2.get(c))))
                return false;
        }
        System.out.println(freqCountS1 +  " " + freqCountS2);
        return true;
    }

    static public int[] twoSum(int[] nums, int target) {
        int[] output = new int[2];
        Map<Integer, Integer> numMapCount = new HashMap<>();
        for (int i = 0; i < nums.length; i++) {
            if (!numMapCount.containsKey(nums[i])) {
                numMapCount.put(target - nums[i], i);
                continue;
            }
            output[0] = numMapCount.get(nums[i]);
            output[1] = i;
            break;
        }
        return output;
    }

